script: |
  super -f text -I q12140.spq | sort > q12140.out

inputs:
  - name: q12140.spq
    data: |
      SELECT - COUNT ( * ) * - + 8 AS col2, - COUNT ( * ) + COUNT ( * ) + - ( - 33 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1

outputs:
  - name: q12140.out
    data: |
      72	33
